import React from 'react';

function Listings() {
  const listingsData = [
    { id: 1, address: '10 Manning Court', price: '$1,258,900', img: 'https://via.placeholder.com/200x150' },
    { id: 2, address: '59 Peerless Street', price: '$1,280,000', img: 'https://via.placeholder.com/200x150' },
    { id: 3, address: '656 Parade Drive', price: '$878,000', img: 'https://via.placeholder.com/200x150' },
    { id: 4, address: '82 Hansen Avenue', price: '$1,200,000', img: 'https://via.placeholder.com/200x150' },
    { id: 5, address: '552 Silvertip Lane', price: '$2,350/mth', img: 'https://via.placeholder.com/200x150' },
  ];

  return (
    <section className="listings">
      <div className="container">
        <h2>Living in Ottawa</h2>
        <div className="listings-grid">
          {listingsData.map((listing) => (
            <div key={listing.id} className="listing-card">
              <img src={listing.img} alt={listing.address} />
              <p>{listing.address}</p>
              <p className="price">{listing.price}</p>
              <p>Royal LePage Team Realty</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Listings;
